class Solution:
    def isPalindrome(self, s: str) -> bool:
        return s == s[::-1]

    def longestPalindrome(self, s: str) -> str:
        max_palindrome = s[0]
        i = 0
        while i < (len(s)-1):
            j = len(s)
            while j > i and len(max_palindrome) < j - i + 1:
                if(self.isPalindrome(s[i:j+1]) and len(s[i:j+1]) > len(max_palindrome)):
                    max_palindrome = s[i:j+1]
                j -= 1
            i += 1
        return max_palindrome

s = Solution()

print(s.longestPalindrome(""))